INSERT INTO `wp_posts` VALUES (4,2,'2014-12-05 16:16:38','2014-12-05 16:16:38','<strong><img class=\"alignright size-full wp-image-16\" src=\"http://mcrrcsenecagre.wpengine.com/wp-content/uploads/2014/12/stgm-logo-small2.png\" alt=\"stgm-logo-small2\" width=\"181\" height=\"200\" />Race Date</strong>\r\nSaturday, March 7, 2015\r\n\r\nWeve made a number of changes for the running of the annual Seneca Creek Greenway Trail Marathon and 50k for 2015, and were excited to share we have new directors, a new out and back course, new registration procedures and a new start &amp; finish at a family friendly location!\r\n\r\nSome of the best things about the past years havent changed however. Were still keeping our early season race as a low-key, low-priced, and fun filled event. And were still running the beautiful Seneca Creek Greenway Trail and youll still have the option to choose your race distance mid-race!\r\n\r\n<strong>Registration\r\n</strong>We will have online registration only. Please note that registration opens Monday, December 8, 2015 and will close when we reach our race cap of 400 runners or by Friday, February 27, 2015 whichever comes first.\r\n\r\n<strong>Cost\r\n</strong>MCRRC members $25. Non-members $35\r\n\r\n<strong>Race Location</strong>\r\nSeneca Creek State Park\r\n11950 Clopper Road\r\nGaithersburg, MD, 20878\r\n\r\n<strong>Directions</strong>\r\nFrom I-270, exit at Clopper Rd W (MD 117). Proceed about 2 miles to the Seneca Creek State Park entrance on your left. Parking is limited so please make efforts to carpool.\r\n\r\nThis year we will have a new out &amp; back, \"lollipop\" loop course. <!--This year we will have a new loop course beginning and ending at Seneca Creek State Park.--> Participants will enjoy views of Seneca Creek from both the north and south banks! The park is a family friendly venue with a large play ground and walking trails to enjoy before, during or after the event. Check it out at: http://dnr2.maryland.gov/publiclands/Pages/central/seneca.aspx\r\n\r\n<strong>Start Time</strong>\r\nBoth the marathon and 50k will start promptly at 7am.\r\n\r\n<strong>Cut offs</strong>\r\nThere will be an 8.5 hour time limit to complete both races so theres plenty of time allowed for whatever extras the course holds on race day. The finish line will close at 3:30pm.','Welcome to Seneca Creek Greenway Trail Marathon & 50k!','','publish','closed','closed','','welcome','','','2014-12-21 19:47:40','2014-12-21 19:47:40','',0,'http://mcrrcsenecagre.wpengine.com/?page_id=4',0,'page','',0);
