INSERT INTO `wp_posts` VALUES (7,2,'2014-12-07 02:16:15','2014-12-07 02:16:15','<strong>Race Date</strong>\nSaturday, March 7, 2015\n\nWeve made a number of changes for the running of the annual Seneca Creek Greenway Trail Marathon and 50k for 2015, and were excited to share we have new directors, a new out and back course, new registration procedures and a new start &amp; finish at a family friendly location!\n\nSome of the best things about the past years havent changed however. Were still keeping our early season race as a low-key, low-priced, and fun filled event. And were still running the beautiful Seneca Creek Greenway Trail and youll still have the option to choose your race distance mid-race!\n\n<strong>Registration\n</strong>We will have online registration only. Please note that registration opens Monday, December 8, 2015 and will close when we reach our race cap of 400 runners or by Friday, February 27, 2015 whichever comes first.\n\n<strong>Cost\n</strong>MCRRC members $25. Non-members $35\n\n<strong>Race Location</strong>\nSeneca Creek State Park\n11950 Clopper Road\nGaithersburg, MD, 20878\n\n<strong>Directions</strong>\nFrom I-270, exit at Clopper Rd W (MD 117). Proceed about 2 miles to the Seneca Creek State Park entrance on your left. Parking is limited so please make efforts to carpool.\n\nThis year we will have a new loop course beginning and ending at Seneca Creek State Park. Participants will enjoy views of Seneca Creek from both the north and south banks! The park is a family friendly venue with a large play ground and walking trails to enjoy before, during or after the event. Check it out at: http://dnr2.maryland.gov/publiclands/Pages/central/seneca.aspx\n\n<strong>Start Time</strong>\nBoth the marathon and 50k will start promptly at 7am.\n\n<strong>Cut offs</strong>\nThere will be an 8.5 hour time limit to complete both races so theres plenty of time allowed for whatever extras the course holds on race day. The finish line will close at 3:30pm.','Welcome to Seneca Creek Greenway Trail Marathon & 50k!','','inherit','open','open','','4-autosave-v1','','','2014-12-07 02:16:15','2014-12-07 02:16:15','',4,'http://mcrrcsenecagre.wpengine.com/2014/12/4-autosave-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (8,2,'2014-12-07 01:35:14','2014-12-07 01:35:14','Q. Can my family and friends come and watch along the course?\r\nA. Yes, just check out the parking directions and be sure to only park in legal spaces and do not ask the aide station volunteers for food and/or drinks. The course does pass over a number of roads which are difficult to park along so spectators should be extremely careful if they will be going to these junctures to support their runners!\r\n\r\nQ. Can my family and friends come to the picnic at the end?\r\nA. Yes, but it is hard enough to plan food for 400 runners and 50 to 100 volunteers so please let us know how many are coming (via e-mail to the race director who will pass it along to the food coordinator) and consider bringing some extra food and drinks.\r\n\r\nQ. I cannot volunteer on race day, can I help in some other way?\r\nA. Absolutely, there are many pre race and post race opportunities. Runners can also thank both park authorities for being so nice and supportive of this race: the Maryland State Department of Natural Resources (MD DNR) stationed out of Seneca Creek State Park. They have been great and have created nice trails that are well cared for and make our race so enjoyable.\r\n\r\nQ. What happens if the sweepers catch me? Will they really pull me from the race?\r\nA. Yes, and please do not argue with them. Argue with the Race Director. It is not fair to the race management and volunteers to work any longer than they are scheduled as it is.\r\n\r\nQ. Can I get hurt, lost, cold, wet, or muddy?\r\nA. Of course.\r\n\r\nQ. Is it easy to get lost or go off course?\r\nA. Not really. There are no guarantees but the trail will be flagged in bright blue and the park service has blue blazes all along the route. We will have maps at the aid stations youll pass through as well. However, even with all these aids, we cant guarantee someone wont get lost.\r\n\r\nQ. Why can\'t the volunteers stop traffic when runners approach one of the rural road crossings?\r\nA. It is against the law. The police have told us absolutely under no circumstances stop traffic.\r\n\r\nQ. I have never run a trail marathon before, can I do this?\r\nA. Youll only know if you try! But, if you have done a road marathon (or marathons) in under four and half hours, are trained and are comfortable on trails, probably. A typical trail pace will be about 1-2 min per mile (depending on conditions, maybe more) to your road pace so plan for that in the cut-off times.\r\n\r\nQ. What are the hazards?\r\nA. If it is snowy, icy or has just rained, the stream crossings can be tricky. Probably the biggest hazards on the trail are the wooden bridges which can become slick on the surface. It is best to walk across these bridges. There are rocks and roots that sometimes cannot be seen. There are no big animals to worry about.\r\n\r\nQ. Why can\'t the course be measured and used as an USATF certified Boston Qualifier?\r\nA. Try the B &amp; A Trail Marathon, it\'s down hill in both directions;-) Seriously, the trail changes every single year. It is our best estimate that both the marathon and 50K exceed 26 and 31+ miles.\r\n\r\nQ. If I have to drop will I get a ride back to my car at the finish?\r\nA. Yes. However, please make sure to follow our DNF policy and come to one of the aid stations to be picked up. We dont want to have our sweepers out searching for someone whos dropped &amp; found their way home without letting anyone know!','Frequently Asked Questions','','publish','closed','closed','','frequently-asked-questions','','','2014-12-07 02:33:20','2014-12-07 02:33:20','',0,'http://mcrrcsenecagre.wpengine.com/?page_id=8',0,'page','',0);
INSERT INTO `wp_posts` VALUES (9,2,'2014-12-07 01:38:47','2014-12-07 01:38:47','Packet Pick-up: Packet pick-up will be race day morning at Seneca Creek Park from 6-6:45am.\r\n\r\nRefunds and Bib Exchanges: We understand things can happen that prevent us from running goal races but in a low-key race like ours its just not practical to process refunds or do bib exchanges. If you decide to withdraw from the race please email the race director and your entry fee will be donated to the Maryland State Park system for continuing improvements to our trail system.\r\n\r\nRace switches: Runners will choose their race distance when they register but should anyone want to switch to the longer distance, as long as they reach the lake check point by 2:30pm, they will be allowed to do this. For those registered for the 50k but not able to do it that day, they will likewise be able to switch to the marathon distance. RUNNERS MUST INFORM the check point volunteers of their switch in order to be timed correctly.\r\n\r\nWeather: Weather in the DC region in early March can be cold so please plan for wintery conditions. We dont often have heavy snow but historically theres been light dusting at the start and temps stay below 50 degrees through the day. Please check the forecast before you come so you are well prepared. If you should want to shed clothes along the way, plan to have a drop bag taken to the midway aid station. See info on drop bags below.\r\n\r\nSafety: Remember when approaching road crossings, CARS are the ones that have the right-of-way! All runners are expected to stop at road crossings. Volunteers will be there to help direct you across roads but will not stop cars.\r\n\r\nTiming: We will use chip timing. The chips will be taped to the back of your bib when you get it. You will need to remove the chip and fasten it to the laces of one of your shoes with the cable ties we include in each runner bag in order to be timed. Make sure these are secure..we have had runners lose their chips en route in years past!\r\n\r\nDNFs: If for any reason you find yourself unable to finish your race, please make your way to the nearest aid station and let the volunteers know so we can get a ride for you back to the park.\r\nBecause we want to make sure everyone is accounted for, its is important that you let someone know you cant continue AND drop your chip with an aid station volunteer. We dont want to be scouring the woods for someone who made their own way home and didnt let anyone know\r\n\r\nDrop Bags: We will allow 1 half-way drop if anyone needs a change of shoes or particular foods/drink. You can put your items in a white kitchen trash bag, put your name on it with a magic marker (easily read makes for easily retrieved) and we will take it to the halfway point aid station. All such bags will be in a clearly visible drop area. You will be responsible to find your own bag.remember, were trail runners and are a fairly self-sufficient group ;-) That said, remember the bag drop is At YOUR OWN RISK.\r\n\r\nWater bottles: Every runner is expected to carry their own water bottle (and personal choice of drink powder). We will enforce our rule of NO water bottleNO racing! Aid Stations will have water and Gatorade probably every five to seven miles. The aide stations will NOT have paper cups for runners however. We want to keep the park clear of any litter!\r\n\r\nOther Details:\r\nPicnic: We will once again have our picnic at the finish line for all runners and spectators. Food and drink will be provided but please consider bringing a dish to share as the numbers are growing and there will be many hungry runners to feed. As a side note, this is on park land so please no open alcohol.\r\n\r\nCarpooling: The race will start and finish in the park this year but we do have limited car space. If you are local, please consider carpooling and if it works, you can meet at the Park &amp; Ride located on Quince Orchard Road by the ramp to get on I270 and carpool in from there.','Additional Details','','publish','closed','closed','','additional-details','','','2014-12-07 02:33:09','2014-12-07 02:33:09','',0,'http://mcrrcsenecagre.wpengine.com/?page_id=9',0,'page','',0);
