INSERT INTO `wp_rg_lead_detail` VALUES (15,3,1,4,'Hi,\r\nCould you please answer a couple of quick questions?\r\n\r\nDo you have a course map for 2015?  Will we run to the Potomac with the lollipop course?\r\n\r\nWill you have stream crossings, with wading, ro');
