INSERT INTO `wp_rg_lead_detail` VALUES (18,4,1,2,'mittendog@hotmail.com');
INSERT INTO `wp_rg_lead_detail` VALUES (19,4,1,3,'Active duty');
INSERT INTO `wp_rg_lead_detail` VALUES (20,4,1,4,'Hello,\r\n\r\nIn past years this race was free for active duty military.  Is this still the case?\r\n\r\nThanks,\r\nMark');
INSERT INTO `wp_rg_lead_detail_long` VALUES (15,'Hi,\r\nCould you please answer a couple of quick questions?\r\n\r\nDo you have a course map for 2015?  Will we run to the Potomac with the lollipop course?\r\n\r\nWill you have stream crossings, with wading, rope guides, etc?\r\n\r\nCan you give me an idea about aid station distances?  Trying to figure out how much water I have to carry versus refill my water bottles.\r\n\r\nThanks so much!  Matt');
